float score(ScoreMode mode) {
  switch (mode) {
    case None:
      return 1.0f;
    case Total:
      return total;
    case Avg:
      return total / count;
    case Max:
      return maxScore;
  }
  throw new IllegalArgumentException("Unsupported ScoreMode: " + mode);
}

float score(ScoreMode mode) {
  switch (mode) {
